        break;
        case 'u':
            char_code = 0x3C;
        break;
        case 'v':
            char_code = 0x2A;
        break;
        case 'w':
            char_code = 0x1D;
        break;
        case 'x':
            char_code = 0x22;
        break;
        case 'y':
